userrights-groups-help:
Бұл қатысушы кіретін топтарды реттей аласыз.
* Құсбелгі қойылған көзі қатысушы бұл топқа кіргенін көрсетеді;
* Құсбелгі алып тасталған көз қатысушы бұл топқа кірмегенін көрсетеді;
* Келтірілген * топты бір үстегенінен кейін аластай алмайтындығын, не қарама-қарсысын көрсетеді.

uploadtext:
Төмендегі пішінді файлдарды жүктеу үшін қолданыңыз.
Алдында жүктелген файлдарды қарау не іздеу үшін [[Special:FileList|жүктелген файлдар тізіміне]] барыңыз. Сондай-ақ файлдардың жүктелуі [[Special:Log/upload|жүктелу журналына]], ал жойылған файлдар [[Special:Log/delete|жойылу журналына]] жазылады.

Файлды мақалаға қосу үшін келесі тәсілдерді қолданыңыз:
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code></strong> файлдың толық нұсқасын орнату үшін;
* <strong><code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|сурет тақырыбы]]</nowiki></code></strong> 200px кішірейтілген файлды «файл тақырыбы» сипаттамасын қосып сол жаққа орналастыру;
* <strong><code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></code></strong> файл көрсетілуінсіз файлға тікелеу сілтеу үшін

